class Solution {
public:
    int trailingZeroes(int n) {
        int res = 0;
        long long a = n/5,b = n/25,c = n/125;
        while(a!=0){
            res += a;
            a /= 5;
        }
        while(b!=0){
            res += b;
            b /= 5;
        }
        while(c!=0){
            res += c;
            c /= 5;
        }
        return res;
    }
};


